	add("prefect", "{\"term\":\"prefect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027prefect\u0027 (French \u0027préfet\u0027 , from Latin \u0027praefectus\u0027 (overseer, director, prefect) Literally \u0027one having been put in charge\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An official of Ancient Rome who controlled or superintended a particular command, charge, department, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027prefect\u0027\u0027 of the aqueducts; the \u0027\u0027prefect\u0027\u0027 of a camp, of a fleet, of the city guard, or of provisions; the pretorian \u0027\u0027prefect\u0027\u0027, who was commander of the troops guarding the emperor\u0027s person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The head of a department in France\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A school pupil in a position of power over other pupils\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A commander\", \"priority\":5}]}, \"synonyms\":{}}");

	add("preferredness", "{\"term\":\"preferredness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|preferred|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being preferre\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A measure of by how much one thing is preferred over another\", \"priority\":2}]}, \"synonyms\":{}}");

	add("preformationism", "{\"term\":\"preformationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|preformation|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the theory that all organisms start their existence already in a predetermined form upon conception and this form does not change in the course of their lifetime (as opposed to epigenesis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pregap", "{\"term\":\"pregap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|gap|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A portion of a compact disc preceding the start of a track\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Chris Sherman, \u0027The CD-ROM handbook\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The CD-I player reads the \u0027\u0027pregap\u0027\u0027 where the CD-I data is stored and displays this information to the consumer\", \"priority\":3}]}, \"synonyms\":{}}");

