	add("preverb", "{\"term\":\"preverb\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|verb|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of words in the Chinese language whose function is analogous to the cases, prepositions and postpositions of other languages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A verbal prefix in the Algonquin languages whose function is analogous to the adjective of other languages\", \"priority\":2}]}, \"synonyms\":{}}");

